import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div id ="container">
        <div id="user">회원가입 / 로그인</div>
        <div id="menu">
          <div id="logo">로고</div>
          <nav id ="topNav">
            <div>서비스 소개</div>
            <div>데이터 업로드</div>
            <div>게시판</div>
          </nav>
        </div>
        <div id="content">
          네이버 지도가 들어갈 자리
        </div>
        <footer>푸터</footer>
      </div>
    </div>
  );
}

export default App;
